import axios from '../apis/ca-be';


export default class User{
    constructor(){
        this.baseUrl = '/user';
    }

    createUser(params){
        axios.post(this.baseUrl + '/create', params).then((response) => {
            console.log('Este es el response: ', response);
        });
    }

    logIn(params){
        axios.post(this.baseUrl + '/logIn', params).then((response) => {
            console.log('Este es el response: ', response);
        });
    }
}
